import React from 'react';
import { Container, Navbar, Nav, NavDropdown } from 'react-bootstrap';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';



function App() {
  return (
    <>
      <div className="App">
      <Navbar bg="light" expand="lg">
        <Container>
          <Navbar.Brand href="#home">React Bootstrap App</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              <Nav.Link href="#home">Home</Nav.Link>
              <Nav.Link href="#link">Link</Nav.Link>
              <Nav.Link href="#about">About</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
        <Container>
          <h1>Create React App est un environnement confortable pour apprendre React, et constitue la meilleure option pour démarrer une nouvelle application web monopage en React. </h1>
          <p>créez une nouvelle application web monopage, alors utilisez Create React App.</p>
        </Container>
      </div>
    </>
  );
}

export default App;
